			shellPath = /bin/sh;
			shellScript = "set -e\n\n# Kill current session if a prior session is still running.\nif [ -n \"$VARS_MULTIPLATFORM_BUILD_IN_PROGRESS\" ]; then\nexit 0\nfi\n\n# Set environment variable to mark this session in progress.\nexport VARS_MULTIPLATFORM_BUILD_IN_PROGRESS=1\n\nVARS_FRAMEWORK_NAME=\"${PROJECT_NAME}.framework\"\nVARS_PLATFORMS=\"OSX iOS watchOS\"\n\n# Builds the static library using the specified SDK.\n# @param sdk  The SDK used (i.e. macosx, iphoneos, iphonesimulator, watchos, watchsimulator)\nfunction build_static_library {\n    SDKS=\"\"\n\n    if [ \"${1}\" == \"OSX\" ]; then\n    SDKS=\"macosx\"\n    elif [ \"${1}\" == \"iOS\" ]; then\n    SDKS=\"iphoneos iphonesimulator\"\n    elif [ \"${1}\" == \"watchOS\" ]; then\n    SDKS=\"watchos watchsimulator\"\n    fi\n\n    for sdk in ${SDKS}; do\n    xcodebuild \\\n    -target \"${PROJECT_NAME} (${1})\" \\\n    -configuration \"${CONFIGURATION}\" \\\n    -sdk \"${sdk}\" \\\n    OTHER_CFLAGS=\"-fembed-bitcode\" \\\n    ONLY_ACTIVE_ARCH=NO \\\n    BUILD_DIR=\"${BUILD_DIR}\" \\\n    BUILD_ROOT=\"${BUILD_ROOT}\" \\\n    clean build\n    done\n}\n\nfunction build_fat_library {\n    LIPO_INPUTS=()\n\n    rm -rf \"${INSTALL_DIR}/${1}\"\n    mkdir \"${INSTALL_DIR}/${1}\"\n\n    if [ \"${1}\" == \"OSX\" ]; then\n    LIPO_INPUTS+=(\"${BUILD_DIR}/${CONFIGURATION}/${VARS_FRAMEWORK_NAME}/${PROJECT_NAME}\")\n    cp -a \"${BUILD_DIR}/${CONFIGURATION}/${VARS_FRAMEWORK_NAME}\" \"${INSTALL_DIR}/${1}\"\n    elif [ \"${1}\" == \"iOS\" ]; then\n    LIPO_INPUTS+=(\"${BUILD_DIR}/${CONFIGURATION}-iphoneos/${VARS_FRAMEWORK_NAME}/${PROJECT_NAME}\")\n    LIPO_INPUTS+=(\"${BUILD_DIR}/${CONFIGURATION}-iphonesimulator/${VARS_FRAMEWORK_NAME}/${PROJECT_NAME}\")\n    cp -a \"${BUILD_DIR}/${CONFIGURATION}-iphoneos/${VARS_FRAMEWORK_NAME}\" \"${INSTALL_DIR}/${1}\"\n    elif [ \"${1}\" == \"watchOS\" ]; then\n    LIPO_INPUTS+=(\"${BUILD_DIR}/${CONFIGURATION}-watchos/${VARS_FRAMEWORK_NAME}/${PROJECT_NAME}\")\n    LIPO_INPUTS+=(\"${BUILD_DIR}/${CONFIGURATION}-watchsimulator/${VARS_FRAMEWORK_NAME}/${PROJECT_NAME}\")\n    cp -a \"${BUILD_DIR}/${CONFIGURATION}-watchos/${VARS_FRAMEWORK_NAME}\" \"${INSTALL_DIR}/${1}\"\n    fi\n\n    lipo -create -output \"${INSTALL_DIR}/${1}/${VARS_FRAMEWORK_NAME}/${PROJECT_NAME}\" \"${LIPO_INPUTS[@]}\"\n}\n\nfor platform in ${VARS_PLATFORMS}; do\nbuild_static_library ${platform}\nbuild_fat_library ${platform}\ndone\n";
